import React from "react";
import { Button, ButtonGroup } from "reactstrap";

const Linksr3 = props => {
  return (
    <ButtonGroup size="lg">
      <Button>
        <img src="http://wellvana.com/wp-content/uploads/2019/10/wellvana-graphic-icons-1_0003_Layer-21.png"></img>
        <p>Access Plan Info</p>
      </Button>
      <Button>
        <img src="http://wellvana.com/wp-content/uploads/2019/10/wellvana-graphic-icons2_0004_motus-creative-group-marketing-agency-service-icons-branding-Asset-2.png"></img>
        <p>Care Management</p>
      </Button>
    </ButtonGroup>
  );
};

export default Linksr3;
